import * as React from "react";
import axios from "axios";
import styled from "styled-components";
import Deleteimg from "../../../../asset/images/Deleteimg.png";
import Button from "@mui/material/Button";
import Dialog from "@mui/material/Dialog";
import DialogActions from "@mui/material/DialogActions";
import DialogContent from "@mui/material/DialogContent";
import DialogContentText from "@mui/material/DialogContentText";
import DialogTitle from "@mui/material/DialogTitle";
import { Alert, Snackbar } from "@mui/material";
import axiosConfig from "../../../../api/configapi";

export default function UnArchive(props) {
  const [data, setData] = React.useState([]);
  console.log("data", data);
  const [open, setOpen] = React.useState(false);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  const [openSnackbar, setOpenSnackbar] = React.useState(false);
  const handleOpenSnackbar = () => {
    setOpen(false);
    setOpenSnackbar(true);
  };
  const handleSnackBarClose = () => {
    setOpenSnackbar(false);
  };
  const handleArDechiveTash = (id) => {
    axiosConfig.delete(`/services/app/Task/DeArchive`, { id: id });

    handleOpenSnackbar();
  };

  //

  const Title = styled.div``;
  return (
    <div>
      <Snackbar
        open={openSnackbar}
        anchorOrigin={{ vertical: "bottom", horizontal: "right" }}
        onClose={handleSnackBarClose}
        autoHideDuration={2000}
      >
        <Alert
          variant="filled"
          severity="success"
          onClose={handleSnackBarClose}
        >
          {`Archive Success ${props.task.name}`}
        </Alert>
      </Snackbar>

      <Button
        style={{ background: "white", color: "black" }}
        variant="outlined"
        onClick={handleClickOpen}
      >
        UnArchive
      </Button>

      <Dialog
        open={open}
        onClose={handleClose}
        aria-labelledby="alert-dialog-title"
        aria-describedby="alert-dialog-description"
      >
        <DialogTitle id="alert-dialog-title">
          <img
            alt=""
            style={{ height: "200px", marginLeft: "60px" }}
            src={`${Deleteimg}`}
          />
        </DialogTitle>

        <DialogContent sx={{ width: "400px", textAlign: "center" }}>
          <DialogContentText id="alert-dialog-description">
            <b style={{ fontSize: "30px" }}>Are you sure?</b>
            <Title>Delete project: "{props.task.name}"?</Title>
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose}>No</Button>
          <Button
            style={{ backgroundColor: "#7cd1f9", color: "#fff" }}
            onClick={() => handleArDechiveTash(props.task.id)}
            autoFocus
          >
            Yes
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}
